Johnny English Reborn is a 2011 British spy comedy film parodying the James Bond secret agent genre. The film is the sequel to Johnny English (2003), and stars Rowan Atkinson reprising his role as the title character[5] and directed by Oliver Parker. The film has a slightly darker tone than the previous film but retains Atkinson's signature humor. Like its predecessor, it was met with mixed reviews but has grossed a total of $159,270,879 worldwide.

